pub fn get_palette() -> Result<RenderedPalette, Box<dyn Error>> {
    let blockstates = serde_json::from_str(blockstates_json);

    let grass_buf = base64::decode(grass_colourmap_png.replace("\n", ""))?;
    let grass = image::load(Cursor::new(grass_buf), image::ImageFormat::Png)?.into_rgba();

    let foliage_buf = base64::decode(foliage_colourmap_png.replace("\n", ""))?;
    let foliage = image::load(Cursor::new(foliage_buf), image::ImageFormat::Png)?.into_rgba();

    let p = RenderedPalette {
        blockstates: blockstates?,
        grass: grass,
        foliage: foliage,
    };

    Ok(p)
}
